    public static boolean generateImage(String imgStr, String imgTar) throws FileNotFoundException {
        try {
            if (imgStr.contains("data:")) {
                int start = imgStr.indexOf(",");
                imgStr = imgStr.substring(start + 1);
            }
            final Base64.Decoder decoder = Base64.getDecoder();
            imgStr = imgStr.replaceAll("\r|\n", "");
            imgStr = imgStr.trim();
            byte[] b = decoder.decode(imgStr);
            //Base64解码
            for (int i = 0; i < b.length; ++i) {
                if (b[i] < 0) {//调整异常数据
                    b[i] += 256;
                }
            }
            //生成jpeg图片
            OutputStream out = new FileOutputStream(imgTar);
            out.write(b);
            out.flush();
            out.close();
            System.out.println("生成图片成功！");
            return true;
        } catch (Exception e) {
            return false;
        }
    }
